import React from 'react';
import './App.css';
import Navigation from './Components/Navigation/Navigation';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import FaceRecognition from "./Components/FaceRecognition/FaceRecognition";
import Rank from "./Components/Rank/Rank"
import Logo from './Components/Logo/Logo';
import Particles from 'react-particles-js';

import 'tachyons';

//API-KEYS 
const Clarifai = require('clarifai');
const app = new Clarifai.App({
  apiKey: '9a35c439201d4365a8f9583d9c6e9612'
 });

const particlesOptions={
  particles: {
    number:{
      value:90,
      density:{
        enable:true,
        value_area:820,
      }
    }
}
}

class App extends React.Component{
  constructor(){
    super();
    this.state={
        input:'',
    }
  }

  onInputChange=(e)=>{
    this.setState({input:e.target.value});
    console.log(e.target.value)
  }

  onButtonSubmit=()=>{ 
    console.log("clicked")
    app.models
    .initModel({id: Clarifai.GENERAL_MODEL, version: "aa7f35c01e0642fda5cf400f543e7c40"})
      .then(generalModel => {
        console.log(generalModel)
        return generalModel.predict("https://samples.clarifai.com/metro-north.jpg");
      })
      .then(response => {
        console.log("response"+response)
        var concepts = response['outputs'][0]['data']['concepts']
        console.log(concepts)
      }) 
      .catch(err=>console.log(err))
  }

  render(){
    return (
    <div className="App">
        <Particles 
          className="particles"
          params={particlesOptions} 

        />
        <div className="flex justify-between items-center">
          <Logo />
          <Navigation />
        </div>
        <Rank />

       <ImageLinkForm 
       onInputChange={this.onInputChange}
       onButtonSubmit={this.onButtonSubmit}  
       />
       <FaceRecognition />

    </div>
  )
}
}

export default App;
